import React from "react";

const Footer = ({callBack}) => {
  return (

    <footer>
    <nav className="nav_footer">
        <ul className="footer_menu">
            <li className="item_footer">
                {/* <a className = "footer_link" >Contact</a> */}
                <button onClick={() => callBack("home")}  >Privacy Policy</button>
            </li>
            <li className="item_footer">
                {/* <a className = "footer_link" >Promote</a> */}
                <button onClick={() => callBack("home")}  >Promote</button>
            </li>
            <li className="item_footer">
                {/* <a className = "footer_link" >Develop</a> */}
                <button onClick={() => callBack("home")}  >Develop</button>
            </li>
        </ul>

    </nav>
</footer>
  );
};

export default Footer;
